import React from 'react'


const Skills = (props) => {

    const { SKILL_LIST } = props;
    return (
        <>
            <h2>Skills:</h2>
            <div>
                {SKILL_LIST.map((skill) => (
                    <>
                        <div key={skill.name}>{skill.name} - points: modifier: total:
                        </div>
                    </>

                ))}
            </div>
        </>
    );
}

export default Skills
